window.bookSummaryJSON = "<p><b>Marriage to a stranger is only the beginning.</b></p> <p><b>She'll have my baby, too.</b></p> <p>Many things have changed while I've been in prison. </p> <p>The Family has been decimated. </p> <p>Our enemies have gotten bolder. </p> <p>My brother has taken the reins as the new Boss.</p> <p>But one thing hasn’t changed: my loyalty. </p> <p>So when I’m released from prison only to be shackled to the daughter of our organization’s biggest traitor, I agree.</p> <p>My new wife has taken oaths to love, honor, and obey.</p> <p>I don’t want her affection. </p> <p>I don’t need her honor. </p> <p>But I will gladly take pleasure in her body. </p> <p>I will force her to carry my child. </p> <p>And I <i>will</i> have her obedience.</p> <p>But when the dark, dangerous secret she harbors threatens to destroy us, my unwilling bride will learn exactly how I mete out punishment to those who break their oaths....</p>"; 
